amework_name}_${time}.zip\n    zip -r -m -o ${framework_name}.framework.zip ${framework_name}.framework || exit 1\n}\n\n# 调用\nbuild_clean\n# build_config\nbuild_framework\nbuild_fat_framework\n# build_zip\n\n";
